Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read.textFile("onsite_data.txt").javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").javaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(new Function[String, (Boolean, Long)] {
      override def call(line: String): (Boolean, Long) = {
        val Array(query, timestamp) = line.split(" ")
        val currentTime = System.currentTimeMillis()

        // Check if query is in top queries
        if (broadcastTopQueries.value.contains(query)) {
          // Check if query is in cache
          if (cache.contains(query)) {
            // Check if query is still valid in cache
            if (currentTime - cache(query) <= 12 * 60 * 60 * 1000) {
              // Cache hit
              (true, 1)
            } else {
              // Cache miss, update cache
              cache.put(query, currentTime)
              (false, 1)
            }
          } else {
            // Cache miss, update cache
            cache.put(query, currentTime)
            (false, 1)
          }
        } else {
          // Query not in top queries, ignore
          (false, 0)
        }
      }
    }).reduce((a, b) => (a._1 || b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = if (hitRate._2 > 0) hitRate._1.toDouble / hitRate._2 else 0.0

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes an empty cache to store the queries and their timestamps. It processes each line in the onsite attributed data and checks if the query is in the top frequent queries. If it is, the job checks if the query is in the cache. If it is, the job checks if the query is still valid in the cache (i.e., it has not expired). If it is still valid, the job counts it as a cache hit. If it is not in the cache or it has expired, the job counts it as a cache miss and updates the cache with the current timestamp.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries processed. The hit rate is printed to the console.

